import axios from "axios";

// eslint-disable-next-line
const getRestaurants = async (token) => {
    const new_token = "eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJlbWFpbCI6InNoYXphbUBnbWFpbC5jb20iLCJzY29wZSI6ImN1c3RvbWVyIiwiYmF0Y2giOiIyMDIxIiwianRpIjoiYmFmMmNlNmYtZDBmMS00MWQxLWE1NTQtMDQ4YzBiNjI3MDViIiwiaWF0IjoxNjQxNjQwNTgyLCJleHAiOjE2NDE2NTQ5ODJ9.Rkd_4qMPiR-z_NUuTD7SUswVRGZs8NSw1WHigOKhwTM";
    const response = await axios.get("http://food-power.glitch.me/restaurants?limit=5&lastDeliveryTime=0", null, { 
        headers: {
            'Authorization' : `Bearer ${new_token}`
            } 
        })
        .catch(err => {
            console.log(err.response);
        });
    return response.data;
};

export default getRestaurants;
